//verifica si es un moderador
import {ROLES, Roles} from '../models/Role'
import User from '../models/User'


export const checkDuplicateUserNmeOrEmail = async (req, res, next)=>{

    const user = await User.findOne({username: req.body.username})
    if(user) return res.status(400).json({message: 'Usuario ya existe'})

    const email = await User.findOne({email: req.body.email})
    if(email) return res.status(400).json({message: 'Email ya existe'})

    next();
}

export const checkRolesExisted = (req, res, next)=>{
        if(req.body.roles){
            for(let i=0; i<req.body.roles.length; i++){
                if(!ROLES.includes(req.body.roles[i])){
                    return res.status(400).json({message: `Role ${req.body.roles[i]} no existe`})
            }
        }    
    }
    next();
}

