import express from 'express'; 
import morgan from 'morgan'; 
import cors from 'cors'; 
import path from 'path';

const app=express();

const mongoose = require('mongoose'); 
//const uri = 'mongodb://localhost:27017/myappprueba';

//const uri='mongodb+srv://user_notas:A27034286j@cluster0.8evgs.mongodb.net/myFirstDatabase?retryWrites=true&w=majority';
const uri='mongodb+srv://admin:admin@tucanchapp.guu3i.mongodb.net/Cluster0?retryWrites=true&w=majority'

const options = {useNewUrlParser: true,  useUnifiedTopology: true};

mongoose.connect(uri, options).then(
    () => { console.log('Conectado a DB') },
    err => { console.log(err) } 
);

//middleware
app.use(morgan('tiny'));
app.use(cors());
app.use(express.json()); 
//application/x-www-form-urlencoded 
app.use(express.urlencoded({ extended: true }))
